import  React,{ useState } from 'react';
import * as a from './StyledLogin.js';


function Login() {
  const [eye, setEye] = useState(true);
  return (
    <a.LoginBox>
      <a.Logo src={require('../../images/LogoBlack.png')}/>
      <a.InputBox placeholder='이메일'/>
      <a.InputBox type={eye ? "password" : ""} placeholder='비밀번호'/>
      <a.EyeIcon src={require('../../images/eye.png')} onClick={() => {
        setEye(!eye);
      }}/>
      <a.LoginError>아이디나 비밀번호가 일치하지않습니다.</a.LoginError>
      <a.LoginBtn >로그인</a.LoginBtn>
      <a.FindWrap>
        <a.FindBox>비밀번호찾기</a.FindBox>
        <a.Contour/>
        <a.FindBox>아이디찾기</a.FindBox>
      </a.FindWrap>
      <a.JoinBtn>회원가입</a.JoinBtn>
    </a.LoginBox>
  );
}

export default Login;
